/* VCD dumping functions */
MOD_mktop_multicore & mktop_multicore_backing(tSimStateHdl simHdl)
{
  static MOD_mktop_multicore *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mktop_multicore(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
